"use strict";(self.webpackChunkiuvc_template=self.webpackChunkiuvc_template||[]).push([[957],{957:function(a,s,e){e.r(s),e.d(s,{default:function(){return d}});const c=(0,e(6252).uE)('<div class="lf-resume_title" data-v-5ae7ac0f><div class="title" data-v-5ae7ac0f>求职简历</div><div class="desc" data-v-5ae7ac0f><p data-v-5ae7ac0f>PERSONAL RESUME</p><p data-v-5ae7ac0f>一直在努力！</p></div></div><div class="lf-resume_content" data-v-5ae7ac0f><div class="content-title" data-v-5ae7ac0f><span class="name" data-v-5ae7ac0f>基本信息</span><div class="line" data-v-5ae7ac0f></div><div class="lf-community_link" data-v-5ae7ac0f><a href="https://github.com/iuvc/magicJs/issues" target="_blank" data-v-5ae7ac0f><i class="iconfont ify-self-github" data-v-5ae7ac0f></i></a><a href="https://blog.csdn.net/weixin_42927679?type=blog" target="_blank" data-v-5ae7ac0f><i class="iconfont ify-self-csdn" data-v-5ae7ac0f></i></a></div></div><div class="content-wrapper base-info" data-v-5ae7ac0f><div class="info-item" data-v-5ae7ac0f><div data-v-5ae7ac0f><span class="label" data-v-5ae7ac0f>姓      名</span>： <span class="value" data-v-5ae7ac0f>刘兴锋</span></div><div data-v-5ae7ac0f><span class="label" data-v-5ae7ac0f>出生年月</span>： <span class="value" data-v-5ae7ac0f>1997-02-02</span></div><div data-v-5ae7ac0f><span class="label" data-v-5ae7ac0f>开发经验</span>： <span class="value" data-v-5ae7ac0f>5年</span></div><div data-v-5ae7ac0f><span class="label" data-v-5ae7ac0f>求职意向</span>： <span class="value" data-v-5ae7ac0f>前端开发工程师</span></div></div><div class="info-item" data-v-5ae7ac0f><div data-v-5ae7ac0f><span class="label" data-v-5ae7ac0f>手      机</span>： <span class="value" data-v-5ae7ac0f>18397879024</span></div><div data-v-5ae7ac0f><span class="label" data-v-5ae7ac0f>邮      箱</span>： <span class="value" data-v-5ae7ac0f>18397879024@163.com</span></div><div data-v-5ae7ac0f><span class="label" data-v-5ae7ac0f>籍      贯</span>： <span class="value" data-v-5ae7ac0f>江西</span></div><div data-v-5ae7ac0f><span class="label" data-v-5ae7ac0f>专      业</span>： <span class="value" data-v-5ae7ac0f>软件工程</span></div></div><div class="personal" data-v-5ae7ac0f></div></div><div class="content-title" data-v-5ae7ac0f><span class="name" data-v-5ae7ac0f>个人技能</span><div class="line" data-v-5ae7ac0f></div></div><div class="content-wrapper" data-v-5ae7ac0f><pre data-v-5ae7ac0f>熟练掌握 HTML、CSS和 JavaScript 三大前端技术。\n熟悉 Html5、ES6、CSS3、TypeScript 以及 Sass 等编程语言。\n熟悉 Vue(Vue3)全家桶、Element-UI(Element Plus)、iView、jQuery、Cube-UI、Uniapp 等前端框架。\n熟悉 ECharts 数据可视化、大屏可视化、MQTT通讯及视频实时监控领域的开发。\n熟悉 SVN、GIT 等版本库管理工具。\n熟悉 Vite、Webpack 和 Gulp 等打包管理工具。\n了解 NodeJs、Python 等编程语言。</pre></div><div class="content-title" data-v-5ae7ac0f><span class="name" data-v-5ae7ac0f>工作经历</span><div class="line" data-v-5ae7ac0f></div></div><div class="content-wrapper ent-info" data-v-5ae7ac0f><div class="ent-item" data-v-5ae7ac0f><div class="ent-name" data-v-5ae7ac0f><i class="horn" data-v-5ae7ac0f></i><span class="name" data-v-5ae7ac0f>杭州炬华科技股份有限公司</span><span class="time" data-v-5ae7ac0f>2018-12 - 2023-07</span><span class="post" data-v-5ae7ac0f>前端开发工程师</span></div><div class="job-content" data-v-5ae7ac0f><p data-v-5ae7ac0f>工作内容：</p><pre data-v-5ae7ac0f>1.主导公司各个项目框架搭建和前端技术选型，以提高项目开发效率和性能。\n2.规范化全局常量和样式的定义，通用组件和方法的封装，确保代码易于维护和扩展。\n3.建立一致的文件夹和文件命名规范，制定前端代码及语法标准，提高代码的可读性和团队协作效率。\n4.负责日常维护公司各项目，积极解决开发需求和项目难题，并协助同事解决技术问题。\n5.管理前端事务的安排和跟进，以确保项目按时高质量完成。\n</pre></div></div><div class="ent-item" data-v-5ae7ac0f><div class="ent-name" data-v-5ae7ac0f><i class="horn" data-v-5ae7ac0f></i><span class="name" data-v-5ae7ac0f>杭州玖迈网络科技有限公司</span><span class="time" data-v-5ae7ac0f>2018-06 - 2018-11</span><span class="post" data-v-5ae7ac0f>前端开发工程师</span></div><div class="job-content" data-v-5ae7ac0f><p data-v-5ae7ac0f>工作内容：</p><pre data-v-5ae7ac0f>1.负责公司项目的日常维护与优化工作，确保项目持续稳定运行，并不断改进用户体验和性能表现。\n2.参与项目需求分析和流程设计，为项目提供深入的技术支持和专业建议，确保项目在初期规划阶段就具备高度可行性和可拓展性。\n3.协同后台开发和 UI 设计团队，紧密合作完成数据交互和动态信息展现的实现，以提供流畅且富有交互性的用户界面。\n</pre></div></div></div><div class="content-title" data-v-5ae7ac0f><span class="name" data-v-5ae7ac0f>项目经验</span><div class="line" data-v-5ae7ac0f></div></div><div class="content-wrapper ent-info project" data-v-5ae7ac0f><div class="ent-item" data-v-5ae7ac0f><div class="ent-name" data-v-5ae7ac0f><i class="horn" data-v-5ae7ac0f></i><span class="name" data-v-5ae7ac0f>集中器配置软件 - 嵌入式web</span><span class="time" data-v-5ae7ac0f></span><span class="post" data-v-5ae7ac0f></span></div><div class="job-content" data-v-5ae7ac0f><p data-v-5ae7ac0f>项目描述：</p><div data-v-5ae7ac0f>       该项目是一个基于 JS 原生 + jQuery + Echarts 技术的海外集中器配置软件。涵盖多语言翻译功能，后端使用了 C 语言编写的公共网关接口 CGI 脚本。主要功能分为运行状态，设备管理，参数设置三大模块，通过前端技术实现强大的交互和数据可视化效果。</div><p data-v-5ae7ac0f>项目贡献：</p><div data-v-5ae7ac0f>       独立开发了项目的嵌入式 web 部分。根据海外市场需求和软硬件要求，选择了JS 原生 + jQuery + Echarts 技术栈。为提高代码复用性，定义并提取了公共常量、样式和方法。采用sessionStorage和 postMessage 解决不同页面间的信息传输问题，确保良好的用户体验。该软件在吉尔吉斯斯坦、埃及和南非等地区成功展开，为公司开拓海外业务做出了重要贡献。</div></div></div><div class="ent-item" data-v-5ae7ac0f><div class="ent-name" data-v-5ae7ac0f><i class="horn" data-v-5ae7ac0f></i><span class="name" data-v-5ae7ac0f>纳宇云能源物联网信息平台 - web系统平台</span><span class="time" data-v-5ae7ac0f></span><a href="https://www.sunriseyny.cn/ems-web" class="post" data-v-5ae7ac0f>https://www.sunriseyny.cn/ems-web</a></div><div class="job-content" data-v-5ae7ac0f><p data-v-5ae7ac0f>项目描述：</p><div data-v-5ae7ac0f>       纳宇云能源物联网信息平台是一款基于Vue.js和Element UI框架的物联网信息平台。该平台包含多个独立的后台管理系统应用，可根据客户需求灵活开放不同功能模块，如远程费控、能耗管理、能效管理、集团应用等。平台集成了多项功能，包括MQTT设备远程通讯、设备实时预警与告警、Echart可视化、大屏展示、视频监控、百度地图等。</div><p data-v-5ae7ac0f>项目贡献：</p><div data-v-5ae7ac0f>       作为制造业传统企业，随着物联网技术的快速发展，公司迫切需要一个自己的物联网系统应用平台。在项目创立初期，我负责前端框架及技术选型工作。经过多方考察，最终选择了Vue.js、Element UI和Echarts技术框架进行开发。为确保项目的高质量和可维护性，我制定了前端代码和语法规范，并封装了全局常量、方法和样式，以提高代码复用率。<br data-v-5ae7ac0f>        随着项目的发展，平台不断集成多个应用，拓展了许多功能模块。五年的持续开发和业务推广使得公司业绩持续增长，目前已有数百个项目在全国各地稳定运行和维护。我的贡献在于为公司创造了一个稳定可靠的物联网平台，推动了公司业务的持续发展和市场竞争力的提升。</div></div></div><div class="ent-item" data-v-5ae7ac0f><div class="ent-name" data-v-5ae7ac0f><i class="horn" data-v-5ae7ac0f></i><span class="name" data-v-5ae7ac0f>智慧充电互联网云服务平台 - 充电运营平台</span><span class="time" data-v-5ae7ac0f></span><a href="https://charging.sunriseyny.cn/charging-web" class="post" data-v-5ae7ac0f>https://charging.sunriseyny.cn/charging-web</a></div><div class="job-content" data-v-5ae7ac0f><p data-v-5ae7ac0f>项目描述：</p><div data-v-5ae7ac0f>       充电运营平台用于管理和监控充电设施的运营和服务。该平台采用现代化的前端技术，包括Vue.js、Element UI和强大的数据可视化工具Echarts，为充电运营提供高效、稳定和用户友好的解决方案。平台主要功能涵盖实时监控、用户管理、运营报表、档案管理和优惠券管理。</div><p data-v-5ae7ac0f>项目贡献：</p><div data-v-5ae7ac0f>       随着新能源政策的兴起，公司决定开拓这一领域的业务，并委派我参与该项目的研发。我负责前端部分，对云平台进行架构迁移，同时整合百度地图API以便定位和查找充电桩位置及相关信息。<br data-v-5ae7ac0f>        借鉴之前的开发经验，我迅速推进了充电运营平台的前端开发工作，在项目开发计划日期前早早地完成了该阶段的任务。这有效地缩短了整个开发周期，帮助公司节省了开发资源和费用。为公司的业务拓展和发展提供了支持。</div></div></div><div class="ent-item" data-v-5ae7ac0f><div class="ent-name" data-v-5ae7ac0f><i class="horn" data-v-5ae7ac0f></i><span class="name" data-v-5ae7ac0f>点点易充 - 微信公众号</span><span class="time" data-v-5ae7ac0f></span><span class="post" data-v-5ae7ac0f></span></div><div class="job-content" data-v-5ae7ac0f><p data-v-5ae7ac0f>项目描述：</p><div data-v-5ae7ac0f>       点点易充是一款电动汽车充电微信公众号，采用Vue.js和Cube UI框架进行开发。该应用通过微信内置API调用腾讯地图，实现获取用户当前地理位置信息，并结合充电桩数据，为用户提供便捷的充电服务。该公众号支持的主要功能包括充电设施查找、充值与退款、订单和充值记录查询、车牌号管理以及优惠券及发票管理。</div><p data-v-5ae7ac0f>项目贡献：</p><div data-v-5ae7ac0f>       随着充电运营web平台的开发进入收尾阶段，考虑到用户侧需求和业务推广，我从零开始。在项目启动阶段，我经过网上查找相关文档和推荐，选择了Vue.js和Cube UI作为技术框架，为公司的移动H5页面研发提供了宝贵经验。<br data-v-5ae7ac0f>        在项目开发过程中，我学习并结合微信开发文档，成功实现了用户授权、地理位置信息获取和微信支付等关键技术。通过我的努力，点点易充公众号顺利上线，并为公司提供了更多业务拓展的可能性。我圆满地完成了公司安排的研发目标，为公司开发新的移动应用奠定了良好的基础。</div></div></div><div class="ent-item" data-v-5ae7ac0f><div class="ent-name" data-v-5ae7ac0f><i class="horn" data-v-5ae7ac0f></i><span class="name" data-v-5ae7ac0f>点点用能 - app</span><span class="time" data-v-5ae7ac0f></span><span class="post" data-v-5ae7ac0f></span></div><div class="job-content" data-v-5ae7ac0f><p data-v-5ae7ac0f>项目描述：</p><div data-v-5ae7ac0f>       点点用能是一款基于dcloud推出的UniApp框架开发的能源消耗记录移动应用。该应用提供账单分析、用量分析和个人中心等功能。用户可以方便地查看能源消耗情况和费用明细，分析尖峰平谷四个时段的能耗量，以更好地判断能源使用是否合理。用户还可以查阅充值记录，了解账户的支出明细。</div><p data-v-5ae7ac0f>项目贡献：</p><div data-v-5ae7ac0f>       为了方便公司营销人员向外推广公司产品，以及用户在移动设备上查看日常生活能耗情况，我在考虑开发周期和研发成本的情况下，选择了dcloud推出的UniApp作为开发框架。然而，之前没有接触过移动应用开发，因此在项目中我不断摸索和学习，在设备接收推送消息、app支付和上架流程等方面遇到了一些挑战。<br data-v-5ae7ac0f>        尽管遇到了一些困难，但我不辜负公司的期望，全力以赴完成了项目的开发。通过我的努力，点点用能移动应用顺利上线，为公司产品推广和用户提供了更好的移动体验，助力公司更好地拓展业务领域。</div></div></div></div><div class="content-title" data-v-5ae7ac0f><span class="name" data-v-5ae7ac0f>教育背景</span><div class="line" data-v-5ae7ac0f></div></div><div class="content-wrapper edu-info" data-v-5ae7ac0f><div class="edu-item" data-v-5ae7ac0f><span data-v-5ae7ac0f>2021-03 - 2023-06</span><span data-v-5ae7ac0f>杭州电子科技大学</span><span data-v-5ae7ac0f>软件工程</span></div><div class="edu-item" data-v-5ae7ac0f><span data-v-5ae7ac0f>2015-09 - 2018-06</span><span data-v-5ae7ac0f>九江职业技术学院</span><span data-v-5ae7ac0f>计算机信息管理</span></div></div><div class="content-title" data-v-5ae7ac0f><span class="name" data-v-5ae7ac0f>自我评价</span><div class="line" data-v-5ae7ac0f></div></div><div class="content-wrapper" data-v-5ae7ac0f> 有较强的自主学习能力，接受能力强，喜欢新知识。<br data-v-5ae7ac0f>有良好的编码习惯，代码风格良好可维护。<br data-v-5ae7ac0f>做事踏实，有耐心，比较稳定。 <br data-v-5ae7ac0f>适应力强，能很快的融入新环境. </div><div class="content-title" data-v-5ae7ac0f><span class="name" data-v-5ae7ac0f>擅长软件</span><div class="line" data-v-5ae7ac0f></div></div><div class="content-wrapper tools" data-v-5ae7ac0f> Visual Studio Code，HBuilderX，Notepad++，Chorme，Firefox，Postman，微信开发者工具 </div></div>',2);var t={mounted(){document.title="刘兴锋-前端开发工程师-五年前端开发经验"}};var d=(0,e(3744).Z)(t,[["render",function(a,s,e,t,d,v){return c}],["__scopeId","data-v-5ae7ac0f"]])}}]);